// src/Freelancer/Freelancer.js
import React from 'react';
import { useNavigate } from 'react-router-dom'; // Updated import
import './Freelancer.css';

const Freelancer = () => {
  const navigate = useNavigate(); // Updated hook

  const handleLogout = () => {
    localStorage.clear();
    navigate('/'); // Updated navigation
    window.location.reload();
  };

  return (
    <div className="freelancer-container">
      <div className="card-container">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title">Bookmark Jobs</h5>
            <p className="card-text">Manage your Bookmarked Jobs</p>
            <button className="btn btn-success" onClick={() => navigate('/freelancer/bmark/job')}>
              Explore Bookmarks
            </button>
          </div>
        </div>
        <div className="card ">
          <div className="card-body">
            <h5 className="card-title">Skills</h5>
            <p className="card-text">Manage your Skills</p>
            <button className="btn btn-primary" onClick={() => navigate('/freelancer/skills')}>
              Explore Skills
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Freelancer;
